public object FfiConverterTypeArgon2Parameters: FfiConverter<Argon2Parameters, Pointer> {

    override fun lower(value: Argon2Parameters): Pointer {
        return value.uniffiClonePointer()
    }

    override fun lift(value: Pointer): Argon2Parameters {
        return Argon2Parameters(value)
    }

    override fun read(buf: ByteBuffer): Argon2Parameters {
        // The Rust code always writes pointers as 8 bytes, and will
